import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import StartWorsService from "../services/startwors.service";
import styled from 'styled-components'

class Personagem extends Component {

    state = {
        herois: {}
    }




    // PEga dado da api antes de continuar o codigo
    componentDidMount() {
        StartWorsService.get(1)
            .then(res => {
                console.log(`res`, res.data);
                const herois = res.data;
                this.setState({ herois });
            })
    }

    render() {
        let teste = styled.td`color: blue;`

        return (
            <ul>
                <div>
                    <tr>
                        <teste> {this.state.herois.eye_color} </teste>
                        <teste> {this.state.herois.name} </teste>
                    </tr>
                </div>
            </ul>
        )
    }
}

export default Personagem;
